import React from "react";
import withLayout from "../../hoc/WithPageLayout";
import './Home.css'
import { NavLink}  from 'react-router-dom'
import girlGroup from '../../../img/pexels-anna-shvets-4672553.jpg';
import ImageSlider from "../../partials/imageSlider/image-slider";


class Home extends React.Component {
    render() {
      return (
        <div>
        {/* Logo */}
        <section>
        <div className="container">
            <h1><img src="components/img/highreslogo.png" alt="human design logo" width="600px" height="600px"/></h1>
            <a className="button" href="shop.html"><b>Shop</b></a>
            <h2>All the tools you need to become the master of your life.</h2>
        </div>  
        </section>
        </div>
      )
    }
  }

  export default withLayout(Home)
